
window.addEventListener("load", function () {
	let preloader = document.getElementById("preloader");
	let wrapper = document.querySelector(".wrapper")
	let bodyPreloader = document.querySelector("body")

	setTimeout(() => {
		bodyPreloader.classList.remove("body-hidden"); // remove scroll while preloading
		wrapper.classList.remove("wrapper--hidden"); // remove wrapper to animate the 1st screen
		preloader.style.display = 'none'; // remove preloader
	}, 800);
})
// --- FIXED HEADER ---//

const headerFixed = () => {
	let hero = document.querySelector(".hero");
	let header = document.querySelector(".header")

	let windowScroll = window.scrollY; // getting the number of hero section in this var
	let heroCenter = hero.offsetHeight / 2; // find the center of hero section

	console.log(heroCenter);

	if (windowScroll > heroCenter) {
		header.classList.add("fixed")
		hero.style.marginTop = `${header.offsetHeight}px`;
	} else {
		header.classList.remove("fixed")
		hero.style.marginTop = `0px`;
	}
}

// headerFixed()
headerFixed();
window.addEventListener("scroll", function () {
	headerFixed();
})

// --- ANIMATION ---//

function onEntry(entry) {
	entry.forEach(change => {
		if (change.isIntersecting) {
			change.target.classList.add('_active');
		} else {
			change.target.classList.remove('_active');
		}
	});
}

let options = {
	threshold: [0.5]
};
let observer = new IntersectionObserver(onEntry, options);
let elements = document.querySelectorAll("._anim");

for (let elm of elements) {
	observer.observe(elm);
}
