const tabsBtn = document.querySelectorAll(".steps__tab");
const tabItems = document.querySelectorAll(".steps__content");

tabsBtn.forEach(oneTabClick) // - optimization

function oneTabClick(item) {
	item.addEventListener("click", function () {

		let currentBtn = item; // getting this item after the itteration
		let contentId = currentBtn.getAttribute("data-tab"); // getting data attribute
		let currentTab = document.querySelector(contentId) // getting current tab by querySelector that contains attribute "data-tab"

		if ( ! currentBtn.classList.contains("steps__tab--active")) // - remove the checking of current click

		{
			tabsBtn.forEach(function (item) {
				item.classList.remove("steps__tab--active")
			})
			tabItems.forEach(function (item) {
				item.classList.remove("steps__content--active")
			})
			// remove active items before the action

			currentBtn.classList.add("steps__tab--active");
			currentTab.classList.add("steps__content--active");
			// add current items after the action
		}

	})
}

document.querySelector(".steps__tab").click()

const popupBtn = document.querySelector(".contact__btn");
const popupBg = document.querySelector(".modal");
const popup = document.querySelector(".modal__form-inner");
const popupClose = document.querySelector(".modal__close-link");

popupBtn.addEventListener("click", function (e) {
	e.preventDefault();

	popupBg.classList.add("modal-show");
	popup.classList.add("modal__form-inner--active");
})

popupClose.addEventListener("click", function (e) {
	e.preventDefault();

	popupBg.classList.remove("modal-show");
	popup.classList.remove("modal__form-inner--active");
})
