const form = document.querySelector('.modal__form');


const telSelector = form.querySelector('input[type="tel"]');
const inputMask = new Inputmask ('+7 (999) 999-99-99');

inputMask.mask(telSelector)
const TOKEN = "6236623541:AAFJvttzwFr1-GmMD-M7u4q3zMpS5Ub-fFM";
const CHAT_ID = "-1001731706835";
const URI_API = `https://api.telegram.org/bot${TOKEN}/sendMessage`;
const formSuccess = document.getElementById("form-success")

document.getElementById('tg').addEventListener('submit', function (e) {
	e.preventDefault();

	let title = document.querySelector(".modal__title");
	let text = document.querySelector(".modal__text");
	let inputs = document.querySelector(".modal__form");
	let btn = document.querySelector(".contact__btn");

	let message = `<b>Заявка с сайта</b>\n`;
	message += `<b>Отправитель: ${this.name.value} </b>\n`,
		message += `<b>Телефон: ${this.tel.value} </b>\n`,
		message += `<b>Почта: ${this.email.value} </b>\n`,
		message += `<b>Сообщение: ${this.message.value} </b>`;

	axios.post(URI_API, {
		chat_id: CHAT_ID,
		parse_mode: 'html',
		text: message
	})
		.then((res) => {
			this.name.value = "";
			this.tel.value = "";
			this.email.value = "";
			this.message.value = "";
			formSuccess.style.display = "flex"
			title.style.visibility = "hidden"
			text.style.visibility = "hidden"
			inputs.style.visibility = "hidden"
			btn.style.visibility = "hidden"

		})
		.catch((err) => {
			console.warn(err);
		})
		.finally(() => {
			console.log('Отправлено');
			setTimeout(function () {
				formSuccess.style.display = "none"
				title.style.visibility = "visible"
				text.style.visibility = "visible"
				inputs.style.visibility = "visible"
				btn.style.visibility = "visible"
			}, 2000);
			btn.style.visibility = "visible"
		})
})


$(function(){
	$('.burger, .overlay, .menu__item a').on('click', function (e) {
		e.preventDefault()
		$('.menu__list').toggleClass('menu__list--open')
		$('.overlay').toggleClass('overlay-active')
	});
	
	// function burgerMenu() {
	// 	let burgerElements = document.querySelectorAll('.burger, .overlay, .menu__item a');
	// 	let menu = document.querySelector('.menu__list');
	// 	let overlay = document.querySelector('.overlay');
	
	// 	burgerElements.addEventListener("click", function (e) {
	// 		e.preventDefault();
	
	// 		menu.classList.toggle("menu__list--open");
	// 		overlay.classList.toggle("overlay-active");
	// 	})
	// }
	
	
	// $('.burger').on('click', function (e) {
	// 	e.preventDefault()
	// 	$('.burger').toggleClass('burger--open')
	// 	$('.burger').toggleClass('burger--close')
	// })
	$(".menu__item a, .button, .footer__menu-list a, .logo").on("click", function (e) {
		//отменяем стандартную обработку нажатия по ссылке
		e.preventDefault()
		//забираем идентификатор блока с атрибута href
		let id = $(this).attr('href'),
			//узнаем высоту от начала страницы до блока на который ссылается якорь+ к топу можно добавить в пикселях насколько можно перемещать от блока вверх со знаком "-" или вниз
			top = $(id).offset().top-130
		//анимируем переход на расстояние - top за 1500 мс
		$('body,html').animate({ scrollTop: top }, 1500)
	});
	
		
	
		$('.about__acc-link').on('click', function (e) {
			e.preventDefault()
			if ($(this).hasClass('about__acc-link--active')) {
				$(this).removeClass('about__acc-link--active')
				$(this).children('.about__text').slideUp()
				stopImmediatePropagation()
			}
			$('.about__acc-link').removeClass('about__acc-link--active')
			$('.about__text').slideUp()
			$(this).toggleClass('about__acc-link--active')
			$(this).children('.about__text').slideDown()
		})
	
	var mixer = mixitup("#portfolio-mix", {
		"animation": {
			"effects": "fade scale(0.05) rotateY(180deg)"
		}
	});
	
	$(".portfolio__filter-btn").on("click", function () {
		$(".portfolio__filter-btn").removeClass("portfolio__filter-btn--active")
		$(this).addClass("portfolio__filter-btn--active");
	})
});